import { render } from "solid-js/web";
import { createSignal, createEffect, For, createMemo } from "solid-js";

function UserName() {
  const [name, setName] = createSignal("John Doe");
  console.log(name())
  return (
    <div>
      <ShowName name={name()}/>
      <input onInput={ev => setName(ev.currentTarget.value)} />
    </div>
  );
}

function ShowName(props) {
  const username = createMemo(() => props.name.replaceAll(" ", ""))
  return (
    <p>
      @{ username() }
    </p>
  )
}

function ShowImage(props) {
  return (
    <img src={props.url} />
  )
}

function MyApp() {

  const [friends, setFriends] = createSignal([
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"
  ])

  function addImageLater() {
    //let newurl = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT4OX1PAfvo87v0IUf4dHEBwNWslJv5rOzo0g&usqp=CAU"
    addImageURL(myURL())
  }

  function addImageURL(url) {
    setFriends(friends().concat(url))
  }

  const [myURL, setMyURL] = createSignal("")

  return (
    <div>
      <p>My 2 frrens</p>
      <For each={friends()}>
        {(nam) => <ShowImage url={nam}/>}
      </For>
      <input onChange={ev => setMyURL(ev.currentTarget.value)}/>
      <button onClick={addImageLater}>Add Image</button>
    </div>
  )
}

render(() => <MyApp />, document.getElementById("app"));
